import React, { Component } from 'react';

export default class AnnualGoals extends React.Component {

    constructor()
    {
        super();
        this.state = {
            reminders: ReminderList, 
            slideIndex: 1
        }  
    }

    render() {
        return (
            <div className="Annual_Goals">
                <h1>Annual Goals</h1>
            </div>
        )
    }
}
